identifiers:
.otd-modal {
    position: fixed;
    z-index: 200;
    left: 0;
    top: 0;
    width: 100%;
    height: 100%;
    overflow: auto;
    background-color: rgb(0, 0, 0);
    background-color: rgba(0, 0, 0, 0.4);
}

.otd-modal-content {
    width: fit-content;
    min-width: 500px;
    margin: auto;
    border-radius: 5px;
    padding: 20px;
    background-color: white;
    color: black;
    top: 20%;
    position: relative;
    max-height: 60%;
    overflow-y: inherit;
    animation: opac 0.2s ease-in-out;
}
html.dark .otd-modal-content {
    background-color: #15202b;
    color: white;
}
.otd-notification-warning > .otd-notification-content::before {
    content: "";
    margin-right: 5px;
}
.otd-notification-error > .otd-notification-content::before {
    content: "";
    margin-right: 5px;
}
.otd-notification-info > .otd-notification-content::before {
    content: "";
    margin-right: 5px;
}
@keyframes opac {
    0% {
        opacity: 0
    }
    100% {
        opacity: 1
    }
}

.otd-modal-close {
    color: #aaaaaa;
    float: right;
    font-size: 20px;
    font-weight: bold;
    top: 0;
    right: 5px;
    position: absolute;
}

.otd-modal-close:hover,
.otd-modal-close:focus {
    color: black;
    text-decoration: none;
    cursor: pointer;
}
